import React from 'react'

export default function Email() {
    return (
        <div className="email">
            <a href="mailto:aechelon.online@gmail.com">
                <button className="email-button">
                    <i class="fas fa-envelope"></i>
                    <p className="info-click">Email</p>
                </button>
            </a>
        </div>
    )
}
